import React, { useState } from "react";
import styled from "styled-components";
import { Button } from "react-bootstrap";
// import "bootstrap/dist/css/bootstrap.min.css";
import Navbar from "../components/Navbar";
import Jumlah from "./components/jumlah/Jumlah";

const Ticket = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  // modal / jumlah
  const [show, setShow] = useState(false);
  const closeModalHandler = () => setShow(false);

  window.onscroll = () => {
    setIsScrolled(window.pageYOffset === 0 ? false : true);
    return () => (window.onscroll = null);
  };

  return (
    <Container>
      <Navbar isScrolled={isScrolled} />
      <div className="bg">
        <div className="flex column">
          <img
            src="https://external-preview.redd.it/qKqDBJXUFlCGtmXyMd3YKnEXvMkv0DRTvH1h7RQe-FU.jpg?auto=webp&s=3a00ebfc084ae73836088232c50069cca9c90631"
            alt=""
          />
        </div>
        <hr />
        <div className="jadwal">
          <h2 className="tgl">14 November 2022</h2>
          <div>
            <div className="modal-container">
              {show ? (
                <div onClick={closeModalHandler} className="back-drop"></div>
              ) : null}
              <button onClick={() => setShow(true)} className="btn-openModal">
                Open Modal
              </button>
              <Modal show={show} close={closeModalHandler} />
            </div>
            <h1>Yare</h1>
          </div>
          export default App;
          <Button className="jam" variant="info">
            12.03
          </Button>{" "}
          <Button className="jam" variant="info">
            13.10
          </Button>{" "}
          <Button className="jam" variant="info">
            14.25
          </Button>{" "}
          <Button className="jam" variant="info">
            15.30
          </Button>{" "}
          <Button className="jam" variant="secondary">
            17.00
          </Button>{" "}
          <Button className="jam" variant="secondary">
            19.10
          </Button>{" "}
          <Button className="jam" variant="secondary">
            20.20
          </Button>{" "}
        </div>
        <hr />
        <div className="jadwal">
          <h2 className="tgl">15 November 2022</h2>
          <Button className="jam" variant="secondary">
            11.10
          </Button>{" "}
          <Button className="jam" variant="secondary">
            13.00
          </Button>{" "}
          <Button className="jam" variant="secondary">
            14.40
          </Button>{" "}
          <Button className="jam" variant="secondary">
            16.00
          </Button>{" "}
          <Button className="jam" variant="secondary">
            17.10
          </Button>{" "}
          <Button className="jam" variant="secondary">
            18.40
          </Button>{" "}
        </div>
        <hr />
        <div className="jadwal">
          <h2 className="tgl">16 November 2022</h2>
          <Button className="jam" variant="secondary">
            12.20
          </Button>{" "}
          <Button className="jam" variant="secondary">
            14.00
          </Button>{" "}
          <Button className="jam" variant="secondary">
            15.30
          </Button>{" "}
          <Button className="jam" variant="secondary">
            16.40
          </Button>{" "}
          <Button className="jam" variant="secondary">
            18.10
          </Button>{" "}
          <Button className="jam" variant="secondary">
            19.50
          </Button>{" "}
        </div>
        <hr />
        <div className="jadwal">
          <h2 className="tgl">17 November 2022</h2>
          <Button className="jam1" variant="secondary">
            10.05
          </Button>{" "}
          <Button className="jam1" variant="secondary">
            13.10
          </Button>{" "}
          <Button className="jam1" variant="secondary">
            15.25
          </Button>{" "}
          <Button className="jam1" variant="secondary">
            16.40
          </Button>{" "}
          <Button className="jam1" variant="secondary">
            17.50
          </Button>{" "}
          <Button className="jam1" variant="secondary">
            18.40
          </Button>{" "}
          <Button className="jam1" variant="secondary">
            20.10
          </Button>{" "}
        </div>
      </div>
    </Container>
  );
};

const Container = styled.div`
  .bg {
    // background-color: lightsteelblue;
    background-color: rgba(10, 9, 9, 0.56);
  }
  img {
    height: 35rem;
  }
  .flex {
    font-size: 2rem;
    font-family: sans-serif;
  }
  hr {
    height: 12px;
  }
  .jadwal {
    margin: 30px;
    // margin-top: 15px;
    font-size: 1.1rem;
    margin-bottom: 30px;
    align-items: center;

    .tgl {
      font-size: 1.5rem;
      // color: black;
    }

    .jam {
      margin-top: 12px;
      font-size: 25px;
      width: 90px;
      height: 40px;
      margin-right: 20px;
    }

    .jam1 {
      margin-top: 12px;
      font-size: 25px;
      width: 90px;
      height: 40px;
      margin-right: 20px;
      margin-bottom: 5rem;
  }
`;

export default Ticket;

